import React from 'react'
import Popup from 'reactjs-popup';
import 'reactjs-popup/dist/index.css';

function addCatPop() {
    return (
        <Popup trigger={<button> Add Cat</button>} position="right center">
            <div>Popup content here !!</div>
        </Popup>
    )
}

export default addCatPop
